import React from "react";

const Category = () => {
  return (
    <ul>
      <li>Adventure</li>
      <li>Business</li>
      <li>Child</li>
      <li>Fantasy</li>
      <li>Food</li>
      <li>Horror</li>
      <li>Romance</li>
      <li>Travel</li>
    </ul>
  );
};

export default Category;
